        let fetch_api = await fetch(yfinance,
            {
                headers:
                {   
                method: 'GET'
                }
            })
        
        
            let data = await fetch_api.json()
            console.log(data)
            setNewsData(data)
    }
    useEffect(()=> 
    { 
        get_ndata()
        
